import React, { Component } from "react";
import {BrowserRouter, Route} from "react-router-dom";
import Customers from "./components/Customers"
import './App.css';



class App extends Component {

    render(){
        return(
            <BrowserRouter>
                <Route path="/customers" component={{Customers}}/>
            </BrowserRouter>
        );
    }

}

export default App;
